import React from "react";
import CountdownTimer from "../Countdown";

export const Home = () => {
  return (
    <div>
      <img className='logo-gta' src='logo-gta.png' alt="" />
      <h1>Release Date</h1>
      <CountdownTimer />
    </div>
  );
};
